(1, '125983', 'ভর্তি বিজ্ঞপ্তি ৬ষ্ঠ-৯ম ২০২৩ শিক্ষাবর্ষ', 'আগামী ০৫ ডিসেম্বর ২০২২ তারিখ হতে অত্র প্রতিষ্ঠানের ওয়েবসাইট www.tepriganjhighschool.edu.bd এর মাধ্যমে অনলাইনে ৬ষ্ঠ-৯ম শ্রেণি পর্যন্ত ভর্তির আবেদন করা যাবে।', '2022-12-01 15:54:23', NULL, NULL, '2022-12-02 02:54:23', '2022-12-04 06:57:10'),
(2, '2019', 'পরীক্ষা প্রসঙ্গে', 'অত্র বিদ্যালয়ের বার্ষিক পরীক্ষা আগামী ০৭/১২/২০২২ইং হতে শুরু হতে যাচ্ছে।', '2022-12-04 06:21:13', NULL, NULL, '2022-12-04 17:21:13', '2022-12-04 17:21:13'),
